int main() {
  int n, m;
  int a, b, color;

  // Input the number of vertices and edges
  scanf("%d", &n);

  // Create nodes for the tree
  for (int i = 1; i <= n; i++) {
    nodes[i] = createNode(i, 0);
  }

  // Input the edges
  for (int i = 1; i < n; i++) {
    scanf("%d %d", &a, &b);
    addChild(nodes[a], nodes[b]);
  }

  // Input the initial colors of the vertices
  for (int i = 1; i <= n; i++) {
    scanf("%d", &color);
    nodes[i]->color = color;
    nodes[i]->subtree_count[color]++;
  }

  // Input the number of commands
  scanf("%d", &m);

  // Process the commands
  char command[2];
  int x, y;
  for (int i = 0; i < m; i++) {
    scanf("%s", command);
    if (command[0] == 'U') {
      scanf("%d %d", &x, &y);
      updateColor(nodes[x], y);
    } else if (command[0] == 'Q') {
      scanf("%d", &y);
      printf("%d\n", calculateEdges(nodes[1], y));
    }
  }

  // Free the allocated memory
  for (int i = 1; i <= n; i++) {
    free(nodes[i]);
  }

  return 0;
}
